 and had a lot of fun spending our time in nature and sleeping in *tents*.\\nB. One of the activities we did was *hiking*. We walked for a very long distance in the forest and climbed the nearby hills.\\nC. *The campsite* was also amazing. It was in a pine forest next to a flowing river.\\nD. To light the fire,*the scouts* collected a large pile of wood. \\nE. At night, we sat in a circle around *the campfire*; there, we had dinner all together and played fun social games.\",\"submitAnswer\":\"Submit\",\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.DragText 1.10\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Sentence Completion (1)\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sentence Completion (1)\"},\"subContentId\":\"11778139-6cb1-46df-a02b-f19da6e32531\"},{\"params\":{\"taskDescription\":\"<p>4. Complete the sentences with the right words.</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"dropZoneIndex\":\"Drop Zone @index.\",\"empty\":\"Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"ariaDraggableIndex\":\"@index of @count draggables.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"textField\":\"A. Mr. Salim was our *scout leader*. He was the one responsible for us and organized the camping trip very well.\\nB. When I go camping, I always make sure I bring *a flashlight*. It helps me find my things in the dark night.\\nC. In nature, some places can be full of mosquitoes and other types of insects, so I usually bring *bug spray*.\\nD. When its time to sleep, I enjoy slipping in my warm *sleeping bag*. It might not be as comfortable as my bed, but it gives me the comfort I need during my trip.\\nE. On the last day of our camping trip, the wind blew in the forest. It was so strong that many tents*collapsed*.\",\"submitAnswer\":\"Submit\",\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.DragText 1.10\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Sentence Completion (2)\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sentence Completion (2)\"},\"subContentId\":\"29db6107-60c3-4d30-8e0e-0fddd5ced5ca\"}],\"disableBackwardsNavigation\":false,\"randomQuestions\":false,\"endGame\":{\"showResultPage\":true,\"showSolutionButton\":true,\"showRetryButton\":true,\"noResultMessage\":\"Finished\",\"message\":\"Your result:\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"solutionButtonText\":\"Show solution\",\"retryButtonText\":\"Retry\",\"finishButtonText\":\"Finish\",\"showAnimations\":false,\"skippable\":false,\"skipButtonText\":\"Skip video\",\"scoreBarLabel\":\"You got @finals out of @totals points\",\"submitButtonText\":\"Submit\"},\"override\":{\"checkButton\":true},\"texts\":{\"prevButton\":\"Previous question\",\"nextButton\":\"Next question\",\"finishButton\":\"Finish\",\"textualProgress\":\"Question: @current of @total questions\",\"jumpToQuestion\":\"Question %d of %total\",\"questionLabel\":\"Question\",\"readSpeakerProgress\":\"Question @current of @total\",\"unansweredText\":\"Unanswered\",\"answeredText\":\"Answered\",\"currentQues
